package com.String.Examples;

public class MethodEquals {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String name1="GNANA";
		String name2="GNANA";
		String name3="gnana";
		boolean e=name1.equals(name2);
		boolean d=name1.equals(name3);
		System.out.println(e+" "+d);

	}

}
